        // e.results.events.venue.name
        // e.results.events.venue.address
        // e.results.events.venue.extended_address  
        
        render(){
                //console.log(this.props.results.performers)


        return(
            this.props.results.events.map((e) => (
                <EventsResultsCard
                _id={e.results.events.id}
                key={e.results.events.id}
                title={e.results.events.title}
                type={e.results.events.performers.type}
                venue={e.results.events.venue.name}
                address={e.results.events.venue.address}
                extended_address={e.results.events.venue.extended_address}
                date={e.results.events.datetime_local}
                // image={e.results.events.performers.image}
                url={e.results.events.url}
                />     
            ))
        )
    }
}


export default EventsResults
